Besides linking the code from multiple object files (.o), the linker must register the address of the entry function of the program on the header of the executable file so that the operating system's loader knows where to start the execution of the program once it starts. By default, in C and C++, the program's entry point is defined by the function called _start . This is a short function that invokes the function main and after main returns, it invokes the exit syscall to inform the operating system that the program has finished. When generating the executable files, C and C++ compilers link an object file that has the implementation of this function. However, the RISC-V compiler used here doesn't link to such file (nor LibC), this way, it is necessary to include an implementation of the function. The following code shows possible implementations to the function exit and the function _start . In this example, the function exit consists of a sequence of instructions in assembly language that copies the value of function parameter (code) to the register a0, puts the value 93 on register a7 and generates a software interrupt (ecall instruction). The software interrupt redirects the execution flow to the operating system, which will use the value on register a7 to determine which syscall was requested and the value on register a0 as a parameter to the call. void exit(int code)
{ __asm__ __volatile__( "mv a0, %0 # return code\n" "li a7, 93 # syscall exit (93) \n" "ecall" : // Output list :"r"(code) // Input list : "a0", "a7" );
} void _start()
{ int ret_code = main(); exit(ret_code);
} The _start function code simply calls the main function, which is implemented by the user, and, after main 's return, invokes the exit function passing the main return value as a parameter. You can copy and paste these two functions on your C programs that will be executed on the ALE simulator. Alternatively, you can put them in a file called start.c and compile/assemble/link the file with your program.

