In general, programs that execute in computer systems that have an operating system don't have direct access to the system's peripherals ( e.g. , monitor, keyboard, mouse, ...), in other words, that can't interact directly with these devices. In this case, all interactions with these devices are done via system calls ( syscalls ). The organization of the Linux operating system is strongly based on the concept of files. In this context, each file is identified by a path and a name ( e.g. , /home/students/john/prog.c). In addition to that, when a file is opened by a program, the operating system associates this file with a file descriptor and returns this file descriptor to the program. The file descriptor is an integer that must be provided by the program every time it requests the operating system to perform an operation with the file ( e.g. , write or read of data). In short, to write to (or read from) a file, the program must: Invoke the operating system with the open syscall to open the file. This syscall will open the file and return an integer that corresponds to the file descriptor of the opened file. Invoke the write or read syscall passing as argument the file descriptor of the file and a buffer to write or read data; and, finally Invoke the operating system with the close syscall to close the file. There are three special file descriptors that are always available and don't have to be opened or closed: STDIN, STDOUT and STDERR. The values of the file descriptors STDIN, STDOUT and STDERR are 0, 1 e 2, respectively. These file descriptors correspond to the standard input, standard output and error output of the program. When the program writes to standard output or error output, the operating system shows what was written on the terminal; where the program is being executed. In case the program reads from standard input, the operating system (i) waits until the user types something in the standard input and press ENTER, and (ii) returns to the program what was typed in the terminal. The following code shows the implementation of a function in C that contains code in RISC-V assembly language to invoke the syscall read . This function contains a set of RISC-V instructions that adjust the parameters and invoke the operating system to perform the read operation through the read syscall . /* read * Parameters: * __fd: file descriptor of the file to be read. * __buf: buffer to store the data read. * __n: maximum amount of bytes to be read. * Return: * Number of bytes read. */
int read(int __fd, const void *__buf, int __n)
{ int ret_val; __asm__ __volatile__( "mv a0, %1 # file descriptor
" "mv a1, %2 # buffer 
" "mv a2, %3 # size 
" "li a7, 63 # syscall read code (63) 
" "ecall # invoke syscall 
" "mv %0, a0 # move return value to ret_val
" : "=r"(ret_val) // Output list : "r"(__fd), "r"(__buf), "r"(__n) // Input list : "a0", "a1", "a2", "a7" ); return ret_val;
} As you don't have access to the C standard library, you can use the function above to perform read operations from the standard input. To do so, just call the function read to the file descriptor of value 0. To use it, you must allocate a buffer, that can be a global variable, like the example below. Note that the global variable (input_buffer) is an array with 10 characters, a 10 byte array. After reading the data, the read function writes the read bytes to the provided buffer and returns the amount of bytes read. The last parameter of the read function indicates the maximum amount of bytes that must be read. In case the amount of bytes that can be read is greater than this value, the read function just writes the maximum amount of bytes (10 in the example below) on the input buffer and returns. The remaining bytes are stored in an internal buffer of the operating system and are returned when the read function is called again. /* Buffer to store the data read */
char input_buffer[10]; int main()
{ /* fd = 0 : reads from standard input (STDIN) */ int n = read(0, (void*) input_buffer, 10); /* … */ return 0;
} The following code shows a possible C implementation of the function write . This C function contains a code in RISC-V assembly language to invoke the system call ( syscall ) write . It invokes the operating system to write __n bytes from the buffer __buf on the file (or device) indicated by the file descriptor, parameter __fd. When __fd = 1, this function writes to the standard output (STDOUT). /* write * Parameters: * __fd: files descriptor where that will be written. * __buf: buffer with data to be written. * __n: amount of bytes to be written. * Return: * Number of bytes effectively written. */
void write(int __fd, const void *__buf, int __n)
{ __asm__ __volatile__( "mv a0, %0 # file descriptor
" "mv a1, %1 # buffer 
" "mv a2, %2 # size 
" "li a7, 64 # syscall write (64) 
" "ecall" : // Output list :"r"(__fd), "r"(__buf), "r"(__n) // Input list : "a0", "a1", "a2", "a7" );
} Again, as you don't have access to the C standard library, you can use the function above to write to the standard output of the program, in other words, the terminal where your program was executed. To do so, just call the function write to the file descriptor 1. The code below shows an example where the write function is called to show a string on the output terminal. /* Allocates a global string with 5 bytes. * Note: the break line character, 
 is encoded * with a single byte */
char my_string[] = "1969
"; int main()
{ /* Prints the first 5 characters from the string on * the standard output, in other words, 1, 9, 6, 9 and break line. */ write(1, my_string, 5); return 0;
} The ALE simulator expects a break line character (
) to print the content written to the standard output on the terminal. This way, you must add a break line character at the end of your buffer or call the function write again with a string that has the break line character. The example above shows a program that prints a string with 5 characters ending with a break line.

